import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar/Navbar';
import Dashboard from './screens/dashboard';
import Incomes from './screens/incomes';
import Expenses from './screens/expenses';
import { GlobalStyle } from './styles/GlobalStyle';
import { GlobalProvider } from './context/globalContext'; // Assuming you have a global context provider
import Chatbot from 'react-chatbot-kit';
import config from './components/Chatbot/config';
import ActionProvider from './components/Chatbot/ActionProvider';
import MessageParser from './components/Chatbot/MessageParser';

function App() {
  return (
    <GlobalProvider> {/* Wrap your app with the GlobalProvider */}
      <GlobalStyle />
      <Router>
        <Navbar />
        <Routes>
          <Route exact path="/dashboard" element={<Dashboard />} /> {/* Remove "/screens" from the path */}
          <Route path="/incomes" element={<Incomes />} /> {/* Remove "/screens" from the path */}
          <Route path="/expenses" element={<Expenses />} /> {/* Remove "/screens" from the path */}
        </Routes>
        <Chatbot
          config={config}
          messageParser={MessageParser}
          actionProvider={ActionProvider}
        />
      </Router>
    </GlobalProvider>
  );
}

export default App;
